[Form]
public class CustEInvoiceIntegrationeInvoice extends FormRun
{
    private QueryBuildRange qbrPosted;

}

public int active()
{
    int ret;

    if (custEinvoiceIntegrationTrans.CustEinvoiceIntegrationError &&
        CustEinvoiceIntegrationError::find(custEinvoiceIntegrationTrans.CustEinvoiceIntegrationError).AllowEdit == NoYes::Yes)
    {
        errorName.allowEdit(true);
    }
    else
    {
        errorName.allowEdit(false);
    }

    ret = super();

    return ret;
}

public void init()
{
    super();

    qbrPosted = findOrCreateRange_W(custEinvoiceIntegrationTrans_ds.queryBuildDataSource(), fieldnum(CustEinvoiceIntegrationTrans, Posted));
}

void clicked()
{
    Dialog                          dialog;
    DialogField                     dialogCustAccount;
    CustEinvoiceIntegration         integration;
    CustEinvoiceIntegration         oldIntegration;
    CustEinvoiceIntegration         tstIntegration;
    CustEinvoiceIntegrationTrans    updIntegrationTrans;

    CustTable                       custTable;
    CustEinvoiceIntegrationTrans    findRecord = custEinvoiceIntegrationTrans.data();
    boolean                     ok;

    dialog = new Dialog();
    dialogCustAccount = dialog.addField(extendedTypeStr(CustAccount));
    if (dialog.run())
    {
        if (dialogCustAccount.value())
        {
            custTable   = CustTable::find(dialogCustAccount.value());
            if (custTable)
            {
                oldIntegration  = CustEinvoiceIntegration::find(custEinvoiceIntegrationTrans.IntRecId);
                integration     = CustEinvoiceIntegration::findByCommon(custTable,
                                                custEinvoiceIntegrationTrans.CustEinvoiceIntegrationTypeTable);
                if (integration.RecId)
                {
                    if (integration.Ref)
                    {
                            Box::stop(strfmt("@SYS119529",
                                              CustEinvoiceIntegrationTypeTable::find(
                                                custEinvoiceIntegrationTrans.CustEinvoiceIntegrationTypeTable).Type,
                                              integration.Ref,
                                              tstIntegration.getKeyId()));
                    }
                    else
                    {
                        tstIntegration = CustEinvoiceIntegration::findByRef(custEinvoiceIntegrationTrans.Ref,
                                    custEinvoiceIntegrationTrans.CustEinvoiceIntegrationTypeTable);
                        if (tstIntegration.RecId)
                        {
                            Box::stop(strfmt("@SYS119529",
                                              CustEinvoiceIntegrationTypeTable::find(
                                                custEinvoiceIntegrationTrans.CustEinvoiceIntegrationTypeTable).Type,
                                              custEinvoiceIntegrationTrans.Ref,
                                              tstIntegration.getKeyId()));
                        }
                        else
                        {
                            ttsbegin;
                            integration = CustEinvoiceIntegration::find(integration.RecId, true);
                            integration.Ref = custEinvoiceIntegrationTrans.Ref;
                            integration.update();
                            ttscommit;
                            ok = true;
                        }
                    }
                }
                else
                {
                    ttsbegin;
                    integration             = CustEinvoiceIntegration::findOrCreate(custTable,
                                                        custEinvoiceIntegrationTrans.CustEinvoiceIntegrationTypeTable,
                                                        custEinvoiceIntegrationTrans.Ref, true);
                    integration.IntTableId  = custTable.TableId;
                    integration.IntRecId    = custTable.RecId;
                    integration.update();
                    ttscommit;
                    ok                      = true;
                }

                if (ok)
                {
                    ttsbegin;
                    update_recordset updIntegrationTrans
                        setting IntRecId = integration.RecId
                        where updIntegrationTrans.CustEinvoiceIntegrationTypeTable == integration.CustEinvoiceIntegrationTypeTable
                            && updIntegrationTrans.Ref == integration.Ref;

                    if (oldIntegration && oldIntegration.RecId != integration.RecId)
                    {
                        if (! (select firstonly custEInvoiceIntegrationTrans
                                    index hint IntRecIdIdx
                                    where custEInvoiceIntegrationTrans.IntRecId == oldIntegration.RecId).RecId)
                        {
                            oldIntegration = CustEinvoiceIntegration::find(oldIntegration.RecId, true);
                            oldIntegration.delete();
                        }
                    }
                    ttscommit;
                }

                custEinvoiceIntegrationTrans_ds.research();
                custEinvoiceIntegrationTrans_ds.positionToRecord(findRecord);
            }
        }
        else
        {
            if (custEinvoiceIntegrationTrans.RecId && CustEinvoiceIntegration::find(custEinvoiceIntegrationTrans.IntRecId).RecId)
            {
                if (Box::yesNo(strfmt("@SYS119538",custEinvoiceIntegrationTrans.keyId()),DialogButton::No) == DialogButton::Yes)
                {
                    ok = false;

                    if ((select firstonly RecId from custEInvoiceIntegrationTrans
                            index IntRecIdIdx
                            where custEInvoiceIntegrationTrans.IntRecId == custEinvoiceIntegrationTrans.IntRecId &&
                                 (custEInvoiceIntegrationTrans.Accepted == NoYes::Yes ||
                                  custEInvoiceIntegrationTrans.Sent     == NoYes::Yes ||
                                  custEInvoiceIntegrationTrans.Posted   == NoYes::Yes
                                 )).RecId)
                    {
                        Box::stop("@SYS119539");
                    }
                    else
                    {
                        if ((select firstonly RecId from custEInvoiceIntegrationTrans
                                index IntRecIdIdx
                                where custEInvoiceIntegrationTrans.IntRecId == custEinvoiceIntegrationTrans.IntRecId &&
                                      custEInvoiceIntegrationTrans.RecId    != custEinvoiceIntegrationTrans.RecId).RecId)
                        {
                            if (Box::yesNo("@SYS119847" + '\r\n' + "@SYS119848",DialogButton::No)==DialogButton::Yes)
                            {
                                if (Box::yesNo("@SYS24514",DialogButton::No)==DialogButton::Yes)
                                {
                                    ok = true;
                                }
                            }
                        }
                        else
                        {
                            ok = true;
                        }

                        if (ok)
                        {
                            try
                            {
                                ttsbegin;
                                integration  = CustEinvoiceIntegration::find(custEinvoiceIntegrationTrans.IntRecId, true);
                                integration.delete();

                                update_recordset updIntegrationTrans
                                    setting IntRecId = 0
                                    where updIntegrationTrans.IntRecId == custEinvoiceIntegrationTrans.IntRecId &&
                                          updIntegrationTrans.RecId != custEinvoiceIntegrationTrans.RecId;

                                custEinvoiceIntegrationTrans.IntRecId = 0;
                                custEinvoiceIntegrationTrans.update();
                                ttscommit;
                            }
                            catch (Exception::Deadlock)
                            {
                                retry;
                            }

                            custEinvoiceIntegrationTrans_ds.research();
                            custEinvoiceIntegrationTrans_ds.positionToRecord(findRecord);
                        }
                    }
                }
            }
        }
    }
}

public void clicked()
{
    CustEinvoiceIntegrationTrans  findRecord = custEinvoiceIntegrationTrans.data();
    super();

    element.setQueryRange();

    custEinvoiceIntegrationTrans_ds.executeQuery();
    custEinvoiceIntegrationTrans_ds.positionToRecord(findRecord);
}
